import React from 'react';

const About = () => {
  return (
    <div className="container">
      <h1>Rólunk</h1>
      <p>Üdvözlünk a Parfümvilágban, ahol az illatok és az egyéniség tökéletes harmóniát alkotnak!</p>
      <h2>Kik vagyunk?</h2>
      <p>A Parfümvilág nem csupán egy webshop, hanem egy egyedülálló platform, amely összegyűjti és összehasonlítja a legjobb online parfümkínálatokat. Küldetésünk, hogy időt és energiát spóroljunk neked, miközben a legmegfelelőbb illatot választod.</p>
      <h2>Miben segíthetünk?</h2>
      <p><strong>Kategóriák szerinti böngészés:</strong> Navigálj könnyedén különböző márkák és illatcsoportok között.</p>
      <p><strong>Árak összehasonlítása:</strong> Találd meg a legjobb ajánlatokat különböző boltokból.</p>
      <p><strong>Újdonságok és klasszikusok:</strong> Fedezd fel az új illatokat és a timeless klasszikusokat.</p>
      <h2>Célunk</h2>
      <p>Szeretnénk, hogy mindenki megtalálja a saját, egyedi illatát. Az illatok többet mondanak rólad, mint gondolnád – mi pedig itt vagyunk, hogy segítsünk ebben az utazásban.</p>
      <h2>Kezdj keresni most</h2>
      <button className="btn btn-primary">Keresés indítása</button>
      
    </div>
  );
};

export default About;
